import React from 'react';
import { useNavigate } from 'react-router-dom';
import { User, Mail, Lock, ShieldCheck } from 'lucide-react';
import logo from './assets/Logo.jpeg';

const Register = () => {
    const navigate = useNavigate();

    const s = {
        wrapper: {
            height: '100vh', width: '100vw',
            display: 'flex', justifyContent: 'center', alignItems: 'center',
        },
        card: {
            background: 'rgba(255, 255, 255, 0.03)',
            backdropFilter: 'blur(25px)',
            WebkitBackdropFilter: 'blur(25px)',
            border: '1px solid rgba(255, 255, 255, 0.1)',
            padding: '50px 45px',
            borderRadius: '40px',
            width: '480px',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            boxShadow: '0 25px 50px rgba(0, 0, 0, 0.6)'
        },
        inputBox: { width: '100%', position: 'relative', marginBottom: '15px' },
        icon: { position: 'absolute', left: '18px', top: '50%', transform: 'translateY(-50%)', color: '#9133ff' },
        input: {
            width: '100%', padding: '16px 16px 16px 50px',
            borderRadius: '16px', border: '1px solid rgba(255,255,255,0.1)',
            background: 'rgba(255,255,255,0.05)', color: 'white', fontSize: '15px', outline: 'none'
        },
        button: {
            width: '100%', padding: '18px', marginTop: '20px',
            background: 'linear-gradient(135deg, #9133ff 0%, #6a00f4 100%)',
            color: 'white', border: 'none', borderRadius: '16px',
            fontWeight: '800', cursor: 'pointer', boxShadow: '0 10px 25px rgba(145, 51, 255, 0.3)'
        }
    };

    return (
        <div style={s.wrapper}>
            <div style={s.card}>
                <img src={logo} alt="Trellis" style={{width: '130px', mixBlendMode: 'screen', marginBottom: '10px'}} />
                <h2 style={{color: 'white', fontSize: '28px', fontWeight: '800', marginBottom: '30px'}}>Join Trellis</h2>
                
                <form style={{width: '100%'}}>
                    <div style={s.inputBox}>
                        <User size={18} style={s.icon} />
                        <input style={s.input} type="text" placeholder="Full Name" />
                    </div>
                    <div style={s.inputBox}>
                        <Mail size={18} style={s.icon} />
                        <input style={s.input} type="email" placeholder="Email Address" />
                    </div>
                    <div style={s.inputBox}>
                        <Lock size={18} style={s.icon} />
                        <input style={s.input} type="password" placeholder="Password" />
                    </div>
                    <div style={s.inputBox}>
                        <ShieldCheck size={18} style={s.icon} />
                        <input style={s.input} type="password" placeholder="Confirm Password" />
                    </div>
                    <button style={s.button}>CREATE ACCOUNT</button>
                </form>

                <p style={{color: '#999', marginTop: '30px', fontSize: '14px'}}>
                    Already a member? <span onClick={() => navigate('/')} style={{color: '#9133ff', cursor: 'pointer', fontWeight: '700'}}>Log In</span>
                </p>
            </div>
        </div>
    );
};

export default Register;
